Người dân này đặt câu hỏi: “Khi cán bộ công an thực hiện nhiệm vụ tuần tra, kiểm soát dừng phương tiện để kiểm tra hành chính thì người bị dừng phương tiện có quyền đề nghị cán bộ công an cho xem văn bản được cử đi làm nhiệm vụ hay không? Nếu chiến sĩ công an từ chối không xuất trình thì người bị dừng phương tiện có quyền không xuất trình giấy tờ không? Bởi trong thực tế có rất nhiều trường hợp lợi dụng việc kiểm tra hành chính, giả danh cán bộ công an đang làm nhiệm vụ để làm những việc trái với quy định pháp luật ảnh hưởng đến uy tín, hình ảnh của chiến sĩ Công an nhân dân”.

Theo Bộ Công an, pháp luật hiện hành quy định, trong khi làm nhiệm vụ tuần tra, kiểm soát giao thông, cán bộ, chiến sỹ CSGT được dừng các phương tiện đang tham gia giao thông để kiểm soát phương tiện, giấy tờ của phương tiện, kiểm soát người và giấy tờ của người điều khiển phương tiện, xử lý các trường hợp vi phạm pháp luật.

Cán bộ, chiến sỹ CSGT khi đó là người đại diện cho pháp luật để thực thi nhiệm vụ, còn người tham gia giao thông là đối tượng phải chịu sự kiểm tra của CSGT một cách tuyệt đối, cũng là tuân thủ pháp luật.

“Người dân có quyền theo dõi, giám sát các hoạt động bảo đảm trật tự, an toàn giao thông của lực lượng CSGT nhưng không có quyền “xem văn bản được cử đi làm nhiệm vụ hay không”, vì Kế hoạch công tác của lực lượng CSGT là một loại tài liệu nghiệp vụ của ngành Công an, chỉ có những người có trách nhiệm và có thẩm quyền mới được kiểm tra”- Bộ Công an nhấn mạnh.

Theo Bộ Công an, nếu người tham gia giao thông có nghi ngờ giả danh cán bộ công an thì phải báo cho công an các cấp biết để xử lý, trong đó có thể gọi đến số điện thoại 069.2342608 là đường dây nóng của Cục Cảnh sát giao thông.

Liên quan đến vấn đề trên, Bộ Công an cũng đã ban hành Thông tư số 01/2016 quy định nhiệm vụ, quyền hạn, hình thức, nội dung tuần tra, kiểm soát giao thông đường bộ của CSGT.

Điều 12 Thông tư số 01/2016 nhấn mạnh, việc dừng phương tiện phải bảo đảm các yêu cầu: An toàn, đúng quy định của pháp luật; không làm cản trở đến hoạt động giao thông và khi đã dừng phương tiện phải thực hiện việc kiểm soát, nếu phát hiện vi phạm phải xử lý vi phạm theo đúng quy định của pháp luật.

Cán bộ thực hiện nhiệm vụ tuần tra, kiểm soát được dừng phương tiện để kiểm soát trong 5 trường hợp sau:

- Trực tiếp phát hiện hoặc thông qua phương tiện, thiết bị kỹ thuật nghiệp vụ phát hiện, ghi nhận được các hành vi vi phạm pháp luật về giao thông đường bộ;

- Thực hiện mệnh lệnh, kế hoạch tuần tra, kiểm soát của Cục trưởng Cục Cảnh sát giao thông hoặc Giám đốc Công an cấp tỉnh trở lên;

- Thực hiện kế hoạch tổ chức tuần tra, kiểm soát và xử lý vi phạm, bảo đảm trật tự, an toàn giao thông của Trưởng phòng Tuần tra, kiểm soát giao thông đường bộ cao tốc thuộc Cục Cảnh sát giao thông, Trưởng phòng Cảnh sát giao thông hoặc Trưởng Công an cấp huyện trở lên;

- Có văn bản đề nghị của Thủ trưởng, Phó thủ trưởng cơ quan điều tra; văn bản đề nghị của cơ quan chức năng liên quan về dừng phương tiện để kiểm soát phục vụ công tác bảo đảm an ninh, trật tự, phòng, đấu tranh chống tội phạm và các hành vi vi phạm pháp luật khác. Văn bản đề nghị phải ghi cụ thể thời gian, tuyến đường, phương tiện dừng để kiểm soát, xử lý, lực lượng tham gia phối hợp;

- Tin báo, tố giác về hành vi vi phạm pháp luật của người và phương tiện tham gia giao thôn

